INSERT INTO `wp_posts` VALUES (1,1,'2023-04-11 20:16:04','2023-04-11 20:16:04','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','publish','open','open','','hello-world','','','2023-04-11 20:16:04','2023-04-11 20:16:04','',0,'http://127.0.0.1/?p=1',0,'post','',1),(2,1,'2023-04-11 20:16:04','2023-04-11 20:16:04','<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>No need to be in the mood to go out on a Saturday night<br>You just gotta move to the groove of the music under the spotlight<br>And dance with your eyes closed like no-one else is looking<br>Pay no attention to what all the pretty girls watching could be thinking</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\'Cause now you\'re alive you might aswell enjoy it<br>\'Cause once you\'re dead you\'ll be thrown inside a pit<br>And there won\'t be no dance floor, there won\'t be no mirror ball<br>That last nail on the coffin could just mean the end of all<br>The good old times</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You\'ll have plenty of time to settle down somewhere in the country<br>Find yourself a pretty girl who wants to live like a gipsy<br>Play songs in the meadows, play figures with the shadows<br>Sip hot tea and fall asleep, sat next to a fire glow</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\'Cause yesterday is history, tomorrow is a mistery<br>Today\'s a gift from life to you, to him, to her and to me<br>So all you happy-go-lukies, let\'s go out to party<br>Regrets are hard to forget, but there\'s no need to forget or regret<br>The good old times</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The good, the old, the times</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>So God bless the good old times<br>We all need the good all times<br>Don\'t ever underestimate the good old times</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>God bless the good old times<br>We all need the good all times<br>Don\'t ever underestimate the good old times</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:image {\"id\":16,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://127.0.0.1/wp-content/uploads/2023/04/smile-1-1024x1024.jpg\" alt=\"\" class=\"wp-image-16\"/></figure>\n<!-- /wp:image -->','Smile','','publish','closed','open','','sample-page','','','2023-04-11 20:48:32','2023-04-11 20:48:32','',0,'http://127.0.0.1/?page_id=2',0,'page','',0),(3,1,'2023-04-11 20:16:04','2023-04-11 20:16:04','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://127.0.0.1.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where your data is sent</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->','Privacy Policy','','draft','closed','open','','privacy-policy','','',