t right<br>\'Cause when you\'re laid in bed at night<br>Watching roaches climb the wall<br>If you called your dad he could stop it all, yeah</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You\'ll never live like common people<br>You\'ll never do whatever common people do<br>You\'ll never fail like common people<br>You\'ll never watch your life slide out of view<br>And you dance and drink and screw<br>Because there\'s nothing else to do</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sing along with the common people<br>Sing along and it might just get you through<br>Laugh along with the common people<br>Laugh along even though they\'re really laughing at you<br>And the stupid things that you do<br>Because you think that poor is cool</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Like a dog lying in a corner<br>They will bite you and never warn you<br>Look out, they\'ll tear your insides out<br>\'Cause everybody hates a tourist<br>Especially one who thinks it\'s all such a laugh<br>Yeah and the chip stains and grease<br>Will come out in the bath</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You will never understand<br>How it feels to live your life<br>With no meaning or control<br>And with nowhere left to go<br>You are amazed that they exist<br>And they burn so bright<br>Whilst you can only wonder why</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Rent a flat above a shop<br>Cut your hair and get a job<br>Smoke some fags and play some pool<br>Pretend you never went to school<br>But still you\'ll never get it right<br>\'Cause when you\'re laid in bed at night<br>Watching roaches climb the wall<br>If you called your dad he could stop it all<br>Yeah</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Never live like common people<br>Never do what common people do<br>Never fail like common people<br>You\'ll never watch your life slide out of view<br>And then dance and drink and screw<br>Because there\'s nothing else