ah and the chip stains and grease<br>Will come out in the bath</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You will never understand<br>How it feels to live your life<br>With no meaning or control<br>And with nowhere left to go<br>You are amazed that they exist<br>And they burn so bright<br>Whilst you can only wonder why</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Rent a flat above a shop<br>Cut your hair and get a job<br>Smoke some fags and play some pool<br>Pretend you never went to school<br>But still you\'ll never get it right<br>\'Cause when you\'re laid in bed at night<br>Watching roaches climb the wall<br>If you called your dad he could stop it all<br>Yeah</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Never live like common people<br>Never do what common people do<br>Never fail like common people<br>You\'ll never watch your life slide out of view<br>And then dance and drink and screw<br>Because there\'s nothing else to do</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Wanna live with common people like you<br>Wanna live with common people like you<br>Wanna live with common people like you<br>Wanna live with common people like you<br>Wanna live with common people like you<br>Wanna live with common people like you<br>I wanna live with common people like you<br>Oh, la, la, la, la<br>Oh, la, la, la, la<br>Oh, la, la, la, la<br>Oh, la, la, la, la<br>Oh you</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":20,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://127.0.0.1/wp-content/uploads/2023/04/dance.jpg\" alt=\"\" class=\"wp-image-20\"/></figure>\n<!-- /wp:image --></blockquote>\n<!-- /wp:quote -->','Common People','','inherit','closed','closed','','18-revision-v1','','','2023-04-11 20:53:08','2023-04-11 20:53:08','',18,'http://127.0.0.1/?p=21',0,'revision','',0),(22,1,'2023-04-11 20:53:56','2023-04-11 20:53:56','','Pin Posts','','inherit','closed'